import React from 'react'

export default function WorkoutPage(props) {

  // // const isDone = () => { 
  // //   props.isDone(true)
  // //   props.changePage("manager")
    
  // }

const goToWorkoutPage = () => {
    props.changePage("manager")
}
  
  return (
    <div>
      <h3>Workout N.O: {props.currentWorkout.wNumber} </h3> 
      <h3>KM: {props.currentWorkout.km} </h3> <br />
      <button className='blueBG largeBtn workoutButton' onClick={''}>success</button><br />
      <button className='blueBG largeBtn workoutButton' onClick={goToWorkoutPage}>failure</button>
    </div>
  )
}
